O PRSENTE INSTRUMENTO CONTRATUAL TEM COMO OBEJTO, A TRANSFERÊNCIA, PELA COMODANTE AO COMODATÁRIO, DOS DIREITOS DE USO E GOZO DE 01 (UM) TELEFONE CELULAR (SMARTPHONE) COM AS SEGUINTES ESPECIFICAÇÕES MÍNIMAS:
- SISTEMA OPERACIONAL: - ANDROID: 6.0.1 OU SUPERIOR; - IOS: 10 OU SUPERIOR;
- TELA DE TOQUE (TOUCH SCREEN) ENTRE 5” E 6”, RESOLUÇÃO DE NO MÍNIMO 720X1280 PIXELS, 15 MILHÕES DE CORES;
- MEMÓRIA INTERNA DE NO MÍNIMO 16 GB;
- MEMÓRIA RAM DE NO MÍNIMO 2 GB;
- PROCESSADOR COM NO MÍNIMO 8 NÚCLEOS FUNCIONANDO A NO MÍNIMO 1,4 GHZ;
- CÂMERA TRASEIRA INTEGRADA COM NO MÍNIMO 13 MEGAPIXELS;
- GPS INTEGRADO;
- VIVA-VOZ INTEGRADO;
- COMPATIBILIDADE COM REDES 2G – GSM, EDGE, GPRS QUE OPERAM NAS FREQUÊNCIAS 850, 900, 1800 E 1900 MHZ;
- COMPATIBILIDADE COM REDES 3G – HSDPA, HSPA, HSPA+ QUE OPERAM NAS FREQUÊNCIAS 850 E 2100 MHZ;
- COMPATIBILIDADE COM REDES 4G – LTE BAND OU SUPERIOR;
- CAPACIDADE PARA 2 CHIPS, DUAL CHIP SIM1 E SIM2;
CONECTIVIDADE PARA NO MÍNIMO USB 2.0;
- CONECTIVIDADE BLUETOOTH;
- CONECTIVIDADE COM REDES SEM FIO ESPECIFICAÇÃO IEEE 802.11B/G/N (WI-FI);
- SUPORTE A CARTÃO DE MEMÓRIA DE, NO MÍNIMO, 64 GBYTES;
- BATERIA DE ÍONS DE LÍTIO COM CAPACIDADE DE SUPORTAR TEMPO DE CONVERSAÇÃO MÍNIMO DE 6 HORAS E ATÉ 240 HORAS EM ESPERA, NO MÍNIMO 2100 MAH;
- CARREGAMENTO VIA CONECTOR USB;
- CAPACIDADE DE ARMAZENAR 800 CONTATOS NA MEMÓRIA INTERNA, COM 3 NÚMEROS POR CONTATO, ENDEREÇO DE E-MAIL E ENDEREÇO POSTAL;
- CAPACIDADE DE EXECUÇÃO DO APLICATIVO IBM NOTES TRAVELER, UTILIZADO PELA UFMG
PARA CONTROLE DE AGENDA E ACESSO A E-MAIL CORPORATIVO;
- CAPACIDADE DE COMPARTILHAMENTO DA CONEXÃO 4G ATRAVÉS DA INTERFACE WI-FI, SEM FILTRAGEM DE TIPOS DE PACOTES, IMPLEMENTADA NO SISTEMA OPERACIONAL;
- DISPONIBILIDADE DE APLICATIVOS QUE PODEM SER BAIXADOS NA LOJA DE APLICATIVOS DO
APARELHO PARA LEITURA DE DOCUMENTOS PDF, DOC E XLS;
- CAPACIDADE DE ATUALIZAÇÃO DO SISTEMA OPERACIONAL (FIRMWARE) ATRAVÉS DA REDE WI- FI, 3G OU 4G;
